-- New York Capital District REMSCO protocols
INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'CD-1001', 'Cardiac Arrest - Adult', 'Cardiac', 'High-quality CPR. Defibrillate VF/VT. Epinephrine 1mg IV/IO q3-5min. Amiodarone 300mg then 150mg. Consider sodium bicarbonate, calcium, magnesium for specific indications.', '', NOW()
FROM counties c WHERE c.name = 'Capital District REMSCO - Albany Schenectady Rensselaer Saratoga' AND c.state = 'New York' LIMIT 1;

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'CD-1002', 'Cardiac Arrest - Pediatric', 'Pediatric', 'CPR 15:2 ratio. Defibrillate 2J/kg. Epinephrine 0.01mg/kg. IO access if IV fails. Consider reversible causes.', '', NOW()
FROM counties c WHERE c.name = 'Capital District REMSCO - Albany Schenectady Rensselaer Saratoga' AND c.state = 'New York' LIMIT 1;

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'CD-2001', 'Stroke', 'Neurological', 'Cincinnati Stroke Scale. Last known well time. Glucose check. Rapid transport. Pre-notification.', '', NOW()
FROM counties c WHERE c.name = 'Capital District REMSCO - Albany Schenectady Rensselaer Saratoga' AND c.state = 'New York' LIMIT 1;

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'CD-3001', 'Trauma - Major', 'Trauma', 'C-spine immobilization. Control hemorrhage. IV access. Rapid transport to trauma center. TXA for significant hemorrhage.', '', NOW()
FROM counties c WHERE c.name = 'Capital District REMSCO - Albany Schenectady Rensselaer Saratoga' AND c.state = 'New York' LIMIT 1;

-- NYC REMSCO protocols
INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'NYC-100', 'Cardiac Arrest', 'Cardiac', 'FDNY protocol: CPR, defibrillation, ACLS drugs. Consider mechanical CPR. Transport with ongoing CPR if appropriate.', '', NOW()
FROM counties c WHERE c.name = 'New York City REMSCO - Manhattan Bronx Brooklyn Queens Staten Island' AND c.state = 'New York' LIMIT 1;

