INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'NYC-300', 'Trauma', 'Trauma', 'Trauma activation criteria. C-spine. Hemorrhage control. IV access. Transport to Level I/II trauma center.', '', NOW()
FROM counties c WHERE c.name = 'New York City REMSCO - Manhattan Bronx Brooklyn Queens Staten Island' AND c.state = 'New York' LIMIT 1;
